import React, { useEffect, useState } from 'react'
import { useRecoilValue } from 'recoil';
import { AdminFlightId, Jwt } from '../Atom/Atom';
import axios from '../Axios/Axios';
import { TicketDetails } from './TicketDetails';

export const FlightBooking = () => {
  const [booking,setBooking]=useState([]);
  const flightid=useRecoilValue(AdminFlightId);
  useEffect(()=>
  {
    axios.post("/mybooking",{id:flightid}).then((result)=>setBooking(result.data.result)).catch((err)=>console.log(err))
  },[]);
  console.log(booking)
  return (
    <div>
      {booking.map((b,i)=>(<TicketDetails booking={b} />))}
      
    </div>
  )
}
